import React, {useState} from "react";
import"./css/Store.css";


function Store() {
    const[formdata, setFormdata] = useState()
    return (
        <div id="additem">
            <form>
                <input placeholder="category" className="additem" ></input>
                <input placeholder="product name" className="additem"></input>
                <input placeholder="image url" className="additem"></input>
                <input type="number" placeholder="price per unit" className="additem"></input>
                <input type="number" placeholder="units in stock" className="additem"></input>
                <button id="inputbutton">Add New Product</button>
            </form>
        </div>
    )
}

export default Store;
